          "message": "Scope distributed queries to the min-time for each engine (#191)\n\n* Reproduce issue 187\r\n\r\n* Scope distributed queries to the min-time for each engine\r\n\r\nThe current algorithm for distributing queries only takes into account\r\nthe max-time advertised by each engine. When a remote engine is deployed\r\nin front of Prometheus or Receivers, those stores can apply retention\r\nperiods at different times, leading to remote aggregations getting calculated\r\non a subset of the data. Since samples from newer engines are prioritized\r\nover samples from older engines, these aggregates will end up in the end-result.\r\n\r\nTo work around the issue, this commit introduces adds a MinTime method to the\r\nremote engine interface. The MinTime is used to scope remote queries at the lower\r\nend so that partial data is never aggregated. The correct value for MinTime should\r\nbe determined by the remote engine itself. In the case of Thanos, we can use the\r\nhighest min-time from all TSDB backed by a given store.\r\n\r\n* Set selector lookback to 0\r\n\r\n* Address code-review comments\r\n\r\n* Use correct opts\r\n\r\n* Add test for double lookback\r\n\r\n* Update README and add support for lookback delta in options\r\n\r\n* Fix typo\r\n\r\n* Add link to issue\r\n\r\n* Truncate milliseconds in queries\r\n\r\n* Add comment on seconds truncation\r\n\r\n* Apply suggestions from code review\r\n\r\nCo-authored-by: Saswata Mukherjee <saswataminsta@yahoo.com>\r\n\r\n* Update README.md\r\n\r\nCo-authored-by: Giedrius Statkeviƒçius <giedriuswork@gmail.com>\r\n\r\n* Propagate lookback delta to Prometheus engine\r\n\r\n---------\r\n\r\nCo-authored-by: Saswata Mukherjee <saswataminsta@yahoo.com>\r\nCo-authored-by: Giedrius Statkeviƒçius <giedriuswork@gmail.com>",
